import Vue from "vue";
import { createApp } from 'vue'
import App from './App.vue'
import VueSpeech from "vue-speech";
import i18n from "./i18n";

const app = createApp(App);
app.use(VueSpeech);
app.mount('#app');

new Vue({
    i18n,
    render: h => h(App)
  }).$mount("#app");
